from collections import deque

def solution(magnetic):
    answer = 0
    for i in range(len(magnetic[0])):
        queue = deque([])
        for j in range(len(magnetic)):
            if magnetic[j][i] == 1:
                queue.append(1)
            elif magnetic[j][i] == 2 and len(queue) > 0 and queue[-1] == 1:
                queue.append(2)
                answer += 1
    
    return answer

